import React, { useState } from "react"
import "./Register.css"
//import axios from "axios"
//import { useHistory } from "react-router-dom"

const Register = () => {

    //const history = useHistory()

    const [user, setUser] = useState({
        name: "",
        email: "",
        password: "",
        reEnterPassword: ""
    })

    const handleChange = e => {
        const { name, value } = e.target
        setUser({
            ...user,
            [name]: value
        })
    }

    // const register = () => {
    //     const { name, email, password, reEnterPassword } = user
    //     if (name && email && password && (password === reEnterPassword)) {
    //         axios.post("http://localhost:9002/register", user)
    //             .then(res => {
    //                 alert(res.data.message)
    //                 history.push("/login")
    //             })
    //     } else {
    //         alert("invlid input")
    //     }

    // }

    return (
        <div id="main-wrapper">

            <div className="container-fluid">
                <div className="row">
                    <div className="col-md-6 left-side">
                        <header>
                            <span>Need an account?</span>
                            <h3>Create Account<br>Make Profits</br></h3>
                        </header>
                    </div>
                    <div className="col-md-6 right-side">
                        <span className="input input--hoshi">
                            <input className="input__field input__field--hoshi" type="text" id="name" />
                            <label className="input__label input__label--hoshi input__label--hoshi-color-3" for="name">
                                <span className="input__label-content input__label-content--hoshi">Name</span>
                            </label>
                        </span>
                        <span className="input input--hoshi">
                            <input className="input__field input__field--hoshi" type="text" id="email" />
                            <label className="input__label input__label--hoshi input__label--hoshi-color-3" for="email">
                                <span className="input__label-content input__label-content--hoshi">E-mail</span>
                            </label>
                        </span>
                        <span className="input input--hoshi">
                            <input className="input__field input__field--hoshi" type="password" id="password" />
                            <label className="input__label input__label--hoshi input__label--hoshi-color-3" for="password">
                                <span className="input__label-content input__label-content--hoshi">Password</span>
                            </label>
                        </span>
                        <span className="input input--hoshi">
                            <input className="input__field input__field--hoshi" type="password" id="password1" />
                            <label className="input__label input__label--hoshi input__label--hoshi-color-3" for="password1">
                                <span className="input__label-content input__label-content--hoshi">Repeat Passowrd</span>
                            </label>
                        </span>
                        <div className="cta">
                            <button className="btn btn-primary pull-left">
                                Sign-Up Now
                            </button>
                            <span><a href="#">I am already a member</a></span>
                        </div>
                        <ul className="social list-inline">
                            <li><a href="#">Facebook</a></li>
                            <li><a href="#">Twitter</a></li>
                            <li><a href="#">Linkedin</a></li>
                        </ul>
                    </div>
                </div>
            </div>
        </div>
    )
}

